import {useEffect, useState} from 'react'
import './toDolist.css'
import ToDoListPage from './../../components/toDoList/ToDoListPage'
import Api from '../../axios/Axios'
const ToDoList = () => {


  const [list,setList] = useState(undefined);
  const [open,setOpen] = useState(undefined);
  const [inProgress, setInProgress] = useState(undefined);
  const [finished, setFinished] = useState(undefined);



  useEffect(()=>{


    const customConfig = {
      headers: {
      'Content-Type': 'application/json',
      "Authorization" : `Bearer ${sessionStorage.getItem('token')}`
      }
  };


    async function loadToDoList(){
      await Api('/user/todolist' ,customConfig).then((data)=>{
        setList(data.data.data)
      })
    }
    loadToDoList()
  },[])




  return (



    <>  
        <div className='todolist-page'>
          {list!== undefined?
          <ToDoListPage listToDoList={list}/>
          :''}
        </div>
    </>  )
}

export default ToDoList
